import React from "react";
import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  {
    id:'e1',
    title:'some new event in orlando'
  },
  {
    id:'e2',
    title:'old event from hayday'
  }
]

export default function EventsPage() {
  return <>
  <div>EventsPage</div>
  <ul>
    {DUMMY_EVENTS.map((eventitem) => <li key={eventitem.id}>
      <Link to={eventitem.title}>{eventitem.title}</Link>
    </li>)}
  </ul>
  </>;
}
